import React from 'react'
import Card from './Card'
import sdata from './Sdata'

function App() {
  ;<>
    <h1>Hello This is Shyam</h1>
    {sdata.map((val) => {
      return (
        <Card
          key={val.id}
          imgsrc={val.imgsrc}
          title={val.title}
          sname={val.sname}
          link={val.link}
        />
      )
    })}
  </>
}
